import React, {useEffect} from 'react';
import {
    Button, ListItem,
    Modal, ModalBody,
    ModalCloseButton,
    ModalContent, ModalFooter,
    ModalHeader,
    ModalOverlay, OrderedList, Text,
    useDisclosure
} from "@chakra-ui/react";
import quizApi from "../../../api/quizApi";
import axios from "axios";

const AssignedUsers = ({isOpen, onOpen, onClose, quizId}) => {

    useEffect(() => {
        const fetchUsers = async () => {
            console.log("get userss")
            try {
                const resp = await axios.get(`http://localhost:8080/api/v1/admin/quiz-assignment/assign-quizzes/${quizId}/users`, {
                    headers: {
                        "Content-Type": "application/json"
                    }
                })
                if (resp.status === 200) {
                    console.log(resp.data);
                }
            } catch (e) {
                console.log("Failed to fetch assigned users ", e);
            }
        }
        fetchUsers();

    }, []);
    return (
        <>
            <Modal closeOnOverlayClick={false} isOpen={isOpen} onClose={onClose}>
                <ModalOverlay/>
                <ModalContent>
                    <ModalHeader>Assigned users</ModalHeader>
                    <ModalCloseButton/>
                    <ModalBody>
                        <OrderedList spacing={4}>
                            <ListItem>Lorem ipsum dolor sit amet</ListItem>
                            <ListItem>Consectetur adipiscing elit</ListItem>
                            <ListItem>Integer molestie lorem at massa</ListItem>
                            <ListItem>Facilisis in pretium nisl aliquet</ListItem>
                        </OrderedList>
                    </ModalBody>

                    <ModalFooter>
                        {/*<Button colorScheme="blue" mr={3}>*/}
                        {/*    Save*/}
                        {/*</Button>*/}
                        <Button onClick={onClose}>Close</Button>
                    </ModalFooter>
                </ModalContent>
            </Modal>


        </>
    );
};

export default AssignedUsers;
